function wppfmAddToQueueString(b){var a=jQuery("#wppfm-feed-list-feeds-in-queue");if(wppfmQueueStringIsEmpty()){a.text(b)}else{a.text(a.text()+","+b)}}function wppfmRemoveFromQueueString(a){var c=jQuery("#wppfm-feed-list-feeds-in-queue");var b=c.text();if(b.indexOf(",")>-1){b=b.endsWith(a)?b.replace(a,""):b.replace(a+",","");c.text(b)}else{wppfmClearQueueString()}}function wppfmQueueStringIsEmpty(){return jQuery("#wppfm-feed-list-feeds-in-queue").text().length<1}function wppfmClearQueueString(){jQuery("#wppfm-feed-list-feeds-in-queue").text("")};